import React from 'react';
// import logo from '../logo.png';

import { Link } from 'react-router-dom';

function Header() {

  function markActive() {
    let div = document.getElementById('topMenu');
    for (let i = 0; i < div.children.length; i++) {
      let childItem = div.children[i];
      childItem.classNameList.remove('active');
    }
    document.activeElement.classNameList.add('active');
  }

  return (
    <nav className="navbar navbar-expanded navbar-default">
    <div className="container">
        <div className="navbar-header">
            <button type="button" className="navbar-toggle" data-toggle="collapse" data-target=".navbar-ex1-collapse">	<i className="fa fa-bars"></i>

            </button> <a className="navbar-brand" href="index.html"><img src="http://placehold.it/30x30&text=logo" /></a>

        </div>
        <div className="collapse navbar-collapse">
            <ul className="nav navbar-nav">
                <li className="active"><a href="#">Hello</a>

                </li>
                <li><a href="#">Stack</a>

                </li>
                <li><a href="#">Overflow</a>

                </li>
            </ul>
            <ul className="nav navbar-nav navbar-right">
                <li className="dropdown"> <a href="#" className="dropdown-toggle" data-toggle="dropdown"><img id="avatar" className="img-circle mr1" src="http://placehold.it/30x30&text=photo" /> John Doe <b className="caret"></b></a>

                    <ul className="dropdown-menu">
                        <li><a href="#" data-pageindex="3">Settings</a>

                        </li>
                        <li><a href="#">Logout</a>

                        </li>
                    </ul>
                </li>
            </ul>
        </div>
    </div>
</nav>
  );
}

export default Header;
